According to the Wikipedia:

&quot;Remember WENN is a comedy-drama television series that aired from 1996 to 1998 on the cable channel American Movie Classics. Created and written by Rupert Holmes (with music also by Holmes) and set at the fictional Pittsburgh radio station WENN in the early 1940s, it depicted events (both dramatic and comic) in the personal and professional lives of the station's staff in the era before and during World War II. It is not related to the real radio station in Alabama known as &quot;WENN&quot; from 1997 to 2008. The series title is a play on the phrase &quot;remember when&quot;.

The show ran for four seasons totalling 56 episodes, including an hour-long Christmas episode. The series was slated for a fifth season, but was cancelled when new management took over AMC. Holmes says that it was his favorite writing experience in his career.[1]&quot;
